import React, { useState, useEffect } from "react";
import {
  UserIcon,
  Cog6ToothIcon,
  ChartBarIcon,
  ClipboardDocumentListIcon,
} from "@heroicons/react/24/outline";

export default function AdminDashboard() {
  const [activeTab, setActiveTab] = useState("overview");
  const [users, setUsers] = useState([]);
  const [logs, setLogs] = useState([]);
  const [loadingUsers, setLoadingUsers] = useState(true);
  const [loadingLogs, setLoadingLogs] = useState(true);
  const [searchTerm, setSearchTerm] = useState("");
  const [roleFilter, setRoleFilter] = useState("all");
  const [statusFilter, setStatusFilter] = useState("all");

  // Pagination states
  const [currentPage, setCurrentPage] = useState(1);
  const usersPerPage = 5;
  const logsPerPage = 5;

  // Fetch data (simulate API calls)
  useEffect(() => {
    setTimeout(() => {
      setUsers([
        { id: 1, name: "Alice", role: "admin", status: "active" },
        { id: 2, name: "Bob", role: "user", status: "suspended" },
        { id: 3, name: "Charlie", role: "user", status: "active" },
        { id: 4, name: "David", role: "moderator", status: "active" },
        { id: 5, name: "Eve", role: "user", status: "active" },
        { id: 6, name: "Frank", role: "user", status: "active" },
      ]);
      setLoadingUsers(false);
    }, 800);

    setTimeout(() => {
      setLogs([
        { id: 1, action: "User Alice logged in", timestamp: "2025-08-10 12:01" },
        { id: 2, action: "Bob uploaded a file", timestamp: "2025-08-10 12:05" },
        { id: 3, action: "Charlie deleted a record", timestamp: "2025-08-10 12:15" },
        { id: 4, action: "David updated settings", timestamp: "2025-08-10 12:20" },
        { id: 5, action: "Eve logged out", timestamp: "2025-08-10 12:30" },
        { id: 6, action: "System backup completed", timestamp: "2025-08-10 12:45" },
      ]);
      setLoadingLogs(false);
    }, 1000);
  }, []);

  // Filters
  const filteredUsers = users.filter((u) => {
    const matchesSearch = u.name.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesRole = roleFilter === "all" || u.role === roleFilter;
    const matchesStatus = statusFilter === "all" || u.status === statusFilter;
    return matchesSearch && matchesRole && matchesStatus;
  });

  // Pagination logic
  const indexOfLastUser = currentPage * usersPerPage;
  const indexOfFirstUser = indexOfLastUser - usersPerPage;
  const currentUsers = filteredUsers.slice(indexOfFirstUser, indexOfLastUser);

  const indexOfLastLog = currentPage * logsPerPage;
  const indexOfFirstLog = indexOfLastLog - logsPerPage;
  const currentLogs = logs.slice(indexOfFirstLog, indexOfLastLog);

  return (
    <div className="p-6">
      {/* Tabs */}
      <div className="flex space-x-4 border-b mb-4">
        <button
          className={`flex items-center px-3 py-2 text-sm ${
            activeTab === "overview" ? "border-b-2 border-blue-500" : ""
          }`}
          onClick={() => setActiveTab("overview")}
        >
          <ChartBarIcon className="h-4 w-4 mr-1" /> Overview
        </button>
        <button
          className={`flex items-center px-3 py-2 text-sm ${
            activeTab === "users" ? "border-b-2 border-blue-500" : ""
          }`}
          onClick={() => setActiveTab("users")}
        >
          <UserIcon className="h-4 w-4 mr-1" /> Users
        </button>
        <button
          className={`flex items-center px-3 py-2 text-sm ${
            activeTab === "logs" ? "border-b-2 border-blue-500" : ""
          }`}
          onClick={() => setActiveTab("logs")}
        >
          <ClipboardDocumentListIcon className="h-4 w-4 mr-1" /> Logs
        </button>
        <button
          className={`flex items-center px-3 py-2 text-sm ${
            activeTab === "settings" ? "border-b-2 border-blue-500" : ""
          }`}
          onClick={() => setActiveTab("settings")}
        >
          <Cog6ToothIcon className="h-4 w-4 mr-1" /> Settings
        </button>
      </div>

      {/* Overview Tab */}
      {activeTab === "overview" && (
        <div>
          <h2 className="text-lg font-semibold mb-3">Quick Stats</h2>
          <div className="grid grid-cols-2 gap-4">
            <div className="p-3 border rounded bg-gray-50">Total Users: {users.length}</div>
            <div className="p-3 border rounded bg-gray-50">Logs Recorded: {logs.length}</div>
          </div>
        </div>
      )}

      {/* Users Tab */}
      {activeTab === "users" && (
        <div>
          <h2 className="text-lg font-semibold mb-3">Manage Users</h2>

          {/* Search & Filters */}
          <div className="flex space-x-2 mb-3">
            <input
              type="text"
              placeholder="Search users..."
              className="border p-1 rounded text-sm"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <select
              className="border p-1 rounded text-sm"
              value={roleFilter}
              onChange={(e) => setRoleFilter(e.target.value)}
            >
              <option value="all">All Roles</option>
              <option value="admin">Admin</option>
              <option value="moderator">Moderator</option>
              <option value="user">User</option>
            </select>
            <select
              className="border p-1 rounded text-sm"
              value={statusFilter}
              onChange={(e) => setStatusFilter(e.target.value)}
            >
              <option value="all">All Status</option>
              <option value="active">Active</option>
              <option value="suspended">Suspended</option>
            </select>
          </div>

          {loadingUsers ? (
            <p className="text-gray-500">Loading users...</p>
          ) : currentUsers.length === 0 ? (
            <p className="text-gray-500">No users found.</p>
          ) : (
            <table className="w-full border">
              <thead>
                <tr className="bg-gray-100 text-sm">
                  <th className="border p-2">Name</th>
                  <th className="border p-2">Role</th>
                  <th className="border p-2">Status</th>
                  <th className="border p-2">Actions</th>
                </tr>
              </thead>
              <tbody>
                {currentUsers.map((u) => (
                  <tr key={u.id} className="text-sm">
                    <td className="border p-2">{u.name}</td>
                    <td className="border p-2">{u.role}</td>
                    <td className="border p-2">{u.status}</td>
                    <td className="border p-2 space-x-2">
                      <button className="px-2 py-1 text-xs bg-blue-500 text-white rounded hover:bg-blue-600">
                        Promote
                      </button>
                      <button className="px-2 py-1 text-xs bg-red-500 text-white rounded hover:bg-red-600">
                        Delete
                      </button>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}

          {/* Pagination */}
          <div className="mt-3 flex space-x-1">
            {Array.from(
              { length: Math.ceil(filteredUsers.length / usersPerPage) },
              (_, i) => (
                <button
                  key={i + 1}
                  onClick={() => setCurrentPage(i + 1)}
                  className={`px-2 py-1 text-xs rounded ${
                    currentPage === i + 1
                      ? "bg-blue-500 text-white"
                      : "bg-gray-200"
                  }`}
                >
                  {i + 1}
                </button>
              )
            )}
          </div>
        </div>
      )}

      {/* Logs Tab */}
      {activeTab === "logs" && (
        <div>
          <h2 className="text-lg font-semibold mb-3">System Logs</h2>
          {loadingLogs ? (
            <p className="text-gray-500">Loading logs...</p>
          ) : currentLogs.length === 0 ? (
            <p className="text-gray-500">No logs available.</p>
          ) : (
            <ul className="space-y-2 text-sm">
              {currentLogs.map((log) => (
                <li key={log.id} className="border p-2 rounded bg-gray-50">
                  <span className="font-medium">{log.action}</span>
                  <span className="text-gray-500 text-xs ml-2">
                    {log.timestamp}
                  </span>
                </li>
              ))}
            </ul>
          )}

          {/* Pagination */}
          <div className="mt-3 flex space-x-1">
            {Array.from({ length: Math.ceil(logs.length / logsPerPage) }, (_, i) => (
              <button
                key={i + 1}
                onClick={() => setCurrentPage(i + 1)}
                className={`px-2 py-1 text-xs rounded ${
                  currentPage === i + 1
                    ? "bg-blue-500 text-white"
                    : "bg-gray-200"
                }`}
              >
                {i + 1}
              </button>
            ))}
          </div>
        </div>
      )}

      {/* Settings Tab */}
      {activeTab === "settings" && (
        <div>
          <h2 className="text-lg font-semibold mb-3">Admin Settings</h2>
          <form className="space-y-3 text-sm">
            <div>
              <label className="block font-medium">System Name</label>
              <input type="text" className="border p-1 rounded w-full" />
            </div>
            <div>
              <label className="block font-medium">Max Users</label>
              <input type="number" className="border p-1 rounded w-full" />
            </div>
            <button
              type="submit"
              className="px-3 py-1 text-sm bg-green-500 text-white rounded hover:bg-green-600"
            >
              Save Changes
            </button>
          </form>
        </div>
      )}
    </div>
  );
}
